import React from "react";

export const Footer = () => {
  return (
    <section>
    <div className=" bg-footerBg bg-no-repeat bg-cover w-[100%] m-0">
          <img
                className="m-0 w-[50%]"
                src="/treaty-png-1.svg"
                alt=""
            />
      </div>
       
</section>
  );
};
